    false,nt"url": null,nt"notes": "This narrative report for Quivira National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1962.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, vegetation control, and wildfires.
    Resource management is outlined; topics include grazing. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    and safety. N-R forms and photographs are attached.",nt"license_title": "License
